import React from 'react'
import { Calendar, momentLocalizer } from 'react-big-calendar'
import moment from 'moment'

const localiser = momentLocalizer(moment)

const HomeScreen = () => {
    return(
        <div>
            <h1>Spinal Health Organiser</h1>
            <Calendar 
                localizer={localiser}
                style={{height: 500}}
            />
        </div>
    )
}

export default HomeScreen
